void four_point_get_M(double k1, double k2, double k3, double x1[4], double y1[4], double x2[4], double y2[4], double rx, double ry, double rz, double M[12])
{
M[0] = (y2[0]*(-(1-k1)*rx*rz+k3*ry)+(1-k1)*rx*ry+k3*rz)*x1[0]+(y2[0]*(-(1-k1)*ry*rz-k3*rx)+k1+(1-k1)*ry*ry)*y1[0]+y2[0]*(-k1-(1-k1)*rz*rz)+(1-k1)*ry*rz-k3*rx;
M[1] = (x2[0]*((1-k1)*rx*rz-k3*ry)-k1-(1-k1)*rx*rx)*x1[0]+(x2[0]*((1-k1)*ry*rz+k3*rx)-(1-k1)*rx*ry+k3*rz)*y1[0]+x2[0]*(k1+(1-k1)*rz*rz)-(1-k1)*rx*rz-k3*ry;
M[2] = (x2[0]*(-(1-k1)*rx*ry-k3*rz)+y2[0]*(k1+(1-k1)*rx*rx))*x1[0]+(x2[0]*(-k1-(1-k1)*ry*ry)+y2[0]*((1-k1)*rx*ry-k3*rz))*y1[0]+x2[0]*(-(1-k1)*ry*rz+k3*rx)+y2[0]*((1-k1)*rx*rz+k3*ry);
M[3] = (y2[1]*(-(1-k1)*rx*rz+k3*ry)+(1-k1)*rx*ry+k3*rz)*x1[1]+(y2[1]*(-(1-k1)*ry*rz-k3*rx)+k1+(1-k1)*ry*ry)*y1[1]+y2[1]*(-k1-(1-k1)*rz*rz)+(1-k1)*ry*rz-k3*rx;
M[4] = (x2[1]*((1-k1)*rx*rz-k3*ry)-k1-(1-k1)*rx*rx)*x1[1]+(x2[1]*((1-k1)*ry*rz+k3*rx)-(1-k1)*rx*ry+k3*rz)*y1[1]+x2[1]*(k1+(1-k1)*rz*rz)-(1-k1)*rx*rz-k3*ry;
M[5] = (x2[1]*(-(1-k1)*rx*ry-k3*rz)+y2[1]*(k1+(1-k1)*rx*rx))*x1[1]+(x2[1]*(-k1-(1-k1)*ry*ry)+y2[1]*((1-k1)*rx*ry-k3*rz))*y1[1]+x2[1]*(-(1-k1)*ry*rz+k3*rx)+y2[1]*((1-k1)*rx*rz+k3*ry);
M[6] = (y2[2]*(-(1-k1)*rx*rz+k3*ry)+(1-k1)*rx*ry+k3*rz)*x1[2]+(y2[2]*(-(1-k1)*ry*rz-k3*rx)+k1+(1-k1)*ry*ry)*y1[2]+y2[2]*(-k1-(1-k1)*rz*rz)+(1-k1)*ry*rz-k3*rx;
M[7] = (x2[2]*((1-k1)*rx*rz-k3*ry)-k1-(1-k1)*rx*rx)*x1[2]+(x2[2]*((1-k1)*ry*rz+k3*rx)-(1-k1)*rx*ry+k3*rz)*y1[2]+x2[2]*(k1+(1-k1)*rz*rz)-(1-k1)*rx*rz-k3*ry;
M[8] = (x2[2]*(-(1-k1)*rx*ry-k3*rz)+y2[2]*(k1+(1-k1)*rx*rx))*x1[2]+(x2[2]*(-k1-(1-k1)*ry*ry)+y2[2]*((1-k1)*rx*ry-k3*rz))*y1[2]+x2[2]*(-(1-k1)*ry*rz+k3*rx)+y2[2]*((1-k1)*rx*rz+k3*ry);
M[9] = (y2[3]*(-(1-k1)*rx*rz+k3*ry)+(1-k1)*rx*ry+k3*rz)*x1[3]+(y2[3]*(-(1-k1)*ry*rz-k3*rx)+k1+(1-k1)*ry*ry)*y1[3]+y2[3]*(-k1-(1-k1)*rz*rz)+(1-k1)*ry*rz-k3*rx;
M[10] = (x2[3]*((1-k1)*rx*rz-k3*ry)-k1-(1-k1)*rx*rx)*x1[3]+(x2[3]*((1-k1)*ry*rz+k3*rx)-(1-k1)*rx*ry+k3*rz)*y1[3]+x2[3]*(k1+(1-k1)*rz*rz)-(1-k1)*rx*rz-k3*ry;
M[11] = (x2[3]*(-(1-k1)*rx*ry-k3*rz)+y2[3]*(k1+(1-k1)*rx*rx))*x1[3]+(x2[3]*(-k1-(1-k1)*ry*ry)+y2[3]*((1-k1)*rx*ry-k3*rz))*y1[3]+x2[3]*(-(1-k1)*ry*rz+k3*rx)+y2[3]*((1-k1)*rx*rz+k3*ry);

}
